const darkColor = "#262726"
const lightColor = "#eaeaea"
const accent = "#cba974";

const theme = {
    light: {
        bg: lightColor,
        elementsColor: "#c2c2c2",
        color: darkColor,
        accent: accent,
    },
    dark: {
        bg: darkColor,
        elementsColor: "#303130",
        color: lightColor,
        accent: accent,
    }
}

export default theme
